import "./App.css";
import React from "react";
import "./index.css";
import imageSrc from "./images/Group 210.png";

function Header() {
  return (
    <div className="header">
      <header className="header">
        <p className="logo-text">Athena</p>
      </header>
    </div>
  );
}

function MainContent() {
  return (
    <div className="main">
      <h2 className="Subtitle">
        Streamline your studies go digital with Athena
      </h2>
      <p className="content">
        We give students a new way to study. Digitally. Find your e-coursebooks,
        documents, and past-exams all in one place. Cheaper than physical books.
        Smarter than physical books.
      </p>
      <h2>Här kommer bilden på datorn</h2>
      <img alt="Image description needed" src="/images/Group 210.png" />
      <h5>
        Hey! We are launching soon, do like other students, join our waitlist!
      </h5>
      <SignupForm />
      <img alt="Additional image description needed" />
      <h5>Are you a publisher wanting to sell your books through Athena?</h5>
      <PublisherButton />
    </div>
  );
}

function SignupForm() {
  return (
    <form>
      <input type="email" placeholder="Your Email Address" />
      <button type="submit">Yes Please!</button>
    </form>
  );
}

function PublisherButton() {
  return <button className="transparent-button">Click here</button>;
}

function App() {
  return (
    <>
      <Header />
      <MainContent />
    </>
  );
}

export default App;
